【サイズの目安】<br> S　 23～23.5cm<br> M 　23.5～24cm<br> L　 24～24.5cm<br> LL 24.5～25cm<br> <br> 参考サイズ【S】<br>高さ：7cm<br>アウトソール：26cm<br>ソール：0.5cm<br>ヒール：0.5cm<br>甲幅：7.5cm<br>甲外周り：14.5cm<br><br>参考サイズ【M】<br>高さ：7.5cm<br>アウトソール：27cm<br>ソール：0.5cm<br>ヒール：0.5cm<br>甲幅：8cm<br>甲外周り：15cm<br><br>参考サイズ【L】<br>高さ：8cm<br>アウトソール：27.5cm<br>ソール：0.5cm<br>ヒール：0.5cm<br>甲幅：8.5cm<br>甲外周り：15.5cm<br><br>参考サイズ【LL】<br>高さ：8.5cm<br>アウトソール：28.5cm<br>ソール：0.5cm<br>ヒール：0.5cm<br>甲幅：9cm<br>甲外周り：16cm<br> <br> 素材：合成皮革<br> （靴ひも部分：本革）<br> ☆STAFF試着info☆<br> 【例】22.5cmのSTAFF：Sサイズでぴったり<br> ※Mを着用すると少し大きいが<br> 厚手の靴下を履けば普段使いには問題なし<br> <br> 【例】24.0～24.5cmのSTAFF：Lサイズでぴったり<br> ※Mは履けないことはないがキツイ<br> LLだと少し大きく感じるが靴下やインソールで<br> 調節すれば問題なし<br>※送料無料(沖縄・離島エリア除く)<style TYPE="text/css">
